import React from 'react';
import '../../App.css';

export default function Products() {
  return <h1 className='products'>
  <p>Đồng hồ Big Ben có tên đầy đủ là tháp đồng hồ của cung điện Westminster, một cấu trúc tháp đồng hồ ở mặt Đông-Bắc của công trình Nhà quốc hội ở Westminster, London. 
  Mặc dù đã được biết đến rộng rãi với cái tên Big Ben, nhưng thực ra, tên này chính là tên của cái chuông nặng nhất (nặng 13,5T) trong năm cái chuông đặt bên trong tháp. 
  Ngoài ra tháp còn hay bị gọi nhầm tên là St. Stephen’s Tower. 
  Vào ngày diễu binh mừng 60 năm trị vì của Nữ hoàng Elizabeth II, Quốc hội Anh đã thông báo tháp đồng hồ Big Ben sẽ được đổi tên thành Tháp Elizabeth kể từ ngày 4 tháng 6 năm 2012. 
  Tháp đồng hồ được đưa là một phần của thiết kế của Charles Barry cho một tòa lâu đài mới, sau khi Lâu đài Westminster bị hỏa hoạn phá hủy đêm 16 tháng 10 năm 1834. 
  Tháp được thiết kế theo phong cách kiến trúc nội thất Gothic một trong những phong cách đỉnh cao của nhân loại.
</p>
  PRODUCTS</h1>;
}
